import layout  from '../_components/layout'
import Home  from '../_components/index'
import Collection  from '../_components/collection/index'
import Search  from '../_components/search/index'
export default {
    path : '/',
    component: layout,
    meta : {
        requiresAuth : false,
        roles : [],
    },
    children :[
        {
            path : '',
            name : 'Home',
            component: Home,
            meta : {
                requiresAuth : false,
                roles : [],
            },
        },
        {
            path : '/collections',
            name : 'Collection',
            component: Collection,
            meta : {
                requiresAuth : false,
                roles : [],
            },
        },
        {
            path : '/search',
            name : 'Search',
            component: Search,
            meta : {
                requiresAuth : false,
                roles : [],
            },
        }
    ]
}
